import "./AccountData.css";

function AccountData(props) {
    return (
        <div className="account-section">
            <h2>Following tickets</h2>
            <ul>
                <li><a href="">The salinger year (2020)</a> (drama,1h 41m) | </li>
            </ul>
            <h2>All your tickets</h2>
        </div>

    );
}

export default AccountData;
